void setup() {
  Serial.begin(9600);// 9,600 bit per second 9.6 kbps
  Serial.println("Starting.");
  pinMode(12,OUTPUT);
}
void loop() {
  if(Serial.available()){
    char c =Serial.read();
    Serial.print("I see : ");
    Serial.println(c);
    if(c=='a'){
      digitalWrite(12,HIGH);
    }else if(c=='b'){
      digitalWrite(12,LOW);
    }
  }
}
